import Document, { Head, Main, NextScript } from 'next/document'

export default class MyDocument extends Document {
  render() {
    return (
      <html>
        <Head>
          {/* Global Site Tag (gtag.js) - Google Analytics */}
          <script
            async
            src={`https://www.googletagmanager.com/gtag/js?id=${process.env.NEXT_PUBLIC_GA_TRACKING_ID}`}
          />
          <script
            dangerouslySetInnerHTML={{
              __html: `
              window.dataLayer = window.dataLayer || [];
              function gtag() {dataLayer.push(arguments);}
              gtag('js', new Date());
              gtag('config', 'AW-653710687');
              gtag('event', 'page_view', {'send_to': 'AW-653710687',});
              
              <a href*="tel:" onclick=”gtag(‘event’, ‘conversion_new’, {‘event_category’: ‘Telephone’ ,‘event_label’: ‘Telephone’});”></a>
              <a href*="https://zalo.me/" onclick=”gtag(‘event’, ‘conversion_new’, {‘event_category’: ‘Zalo’ ,‘event_label’: ‘Zalo’});”></a>
              gtag('event', 'conversion_new', {'send_to': 'AW-653710687'});
                  })
              })
          `,
            }}
          /> 
          
          </Head>
        <body>
          <Main />
          <NextScript />
        </body>
      </html>
    )
  }
}
